export default function getMileageCharges(e,t){let r=0,s=!1;if(Array.isArray(t))for(const{range:a,cost:n}of t){const[t,i]=a.split("-"),o=parseInt(t,10),c=i.includes("+")?parseInt(i.replace("+",""),10):parseInt(i,10);if(i.includes("+")&&e>=o){r=n,s=!0;break}if(e>=o&&e<=c){r=n,s=!0;break}}else{const{cost_per_mile:a,starting_mile:n,base_cost:i}=t,o=parseFloat(a),c=parseInt(n,10),l=parseInt(e,10),p=parseInt(i,10)||0;l>=c&&(r=Math.round((l-c)*o+p),s=!0)}return{inRange:s,cost:r}}